a, Namibia, South Africa and Zimbabwe, whole tusks and pieces) subject to the following:      i) only registered government-owned stocks, originating in the State (excluding seized ivory and ivory of unknown origin);      ii) only to trading partners that have been verified by the Secretariat, in consultation with the Standing Committee, to have sufficient national legislation and domestic trade controls to ensure that the imported ivory will not be re-exported and will be managed in accordance with all requirements of Resolution Conf. 10.10 (Rev. CoP14) concerning domestic manufacturing and trade;    iii) not before the Secretariat has verified the prospective importing countries and the registered government-owned stocks;     iv) raw ivory pursuant to the conditional sale of registered government-owned ivory stocks agreed at CoP12, which are 20,000 kg (Botswana), 10,000 kg (Namibia) and 30,000 kg (South Africa);      v) in addition to the quantities agreed at CoP12, government-owned ivory from Botswana, Namibia, South Africa and Zimbabwe registered by 31 January 2007 and verified by the Secretariat may be traded and despatched, with the ivory in paragraph g) iv) above, in a single sale per destination under strict supervision of the Secretariat;     vi) the proceeds of the trade are used exclusively for elephant conservation and community conservation and development programmes within or adjacent to the elephant range; and    vii) the additional quantities specified in paragraph g) v) above shall be traded only after the Standing Committee has agreed that the above conditions have been met; and h) no further proposals to allow trade in elephant ivory from populations already in Appendix II shall be submitted to the Conference of the Parties for the period from CoP14 and ending nine years from the date of the single sale of ivory that is to take place in accordance with provisions in paragraphs g) i), g) ii), g) iii), g) vi) and g) vii). In addition such further proposals shall be dealt with in accordance with Decisions 14.77 and 14.78 (Rev. CoP15).On a proposal from the Secretariat, the Standing Committee can decide to cause this trade to cease partially or completely in the event of non-compliance by exporting or importing countries, or in the case of proven detrimental impacts of the trade on other elephant populations.All other specimens shall be deemed to be specimens of species included in AppendixÂ I and the trade in them shall be regulated accordingly.','','Angola,Benin,Botswana,Burkina Faso,Burundi,Cameroon,Central African Republic,Chad,Congo,CÃ´te d\'Ivoire,Democratic Republic of the Congo,Djibouti,Equatorial Guinea,Eritrea,Ethiopia,Gabon,Gambia,Ghana,Guinea,Guinea Bissau,Kenya,Liberia,Malawi,Mali,Mauritania,Mozambique,Namibia,Niger,Nigeria,Rwanda,Senegal,Sierra Leone,Somalia,South Africa,South Sudan,Sudan,Swaziland,Togo,Uganda,United Republic of Tanzania,Zambia,Zimbabwe','AO,BJ,BW,BF,BI,CM,CF,TD,CG,CI,CD,DJ,GQ,ER,ET,GA,GM,GH,GN,GW,KE,LR,MW,ML,MR,MZ,NA,NE,NG,RW,SN,SL,SO,ZA,SS,SD,SZ,TG,UG,TZ,ZM,ZW','Angola,Benin,Botswana,Burkina Faso,Cameroon,Central African Republic,Chad,Congo,CÃ´te d\'Ivoire,Democratic Republic of the Congo,Equatorial Guinea,Eritrea,Ethiopia,Gabon,Ghana,Guinea,Guinea Bissau,Kenya,Liberia,Malawi,Mali,Mozambique,Namibia,Niger,Nigeria,Rwanda,Senegal,Sierra Leone,Somalia,South Africa,South Sudan,Sudan,Togo,Uganda,United Republic of Tanzania,Zambia,Zimbabwe','','','Swaziland','Burundi,Djibouti,Gambia,Mauritania,Swaziland','',''),('4522','Animalia','Cnidaria','Anthozoa','Scleractinia','Acroporidae','Acropora','sarmentosa','','Acropora sarmentosa','(Brook, 1892)','SPECIES','II','','Scleractinia spp.','**II** [ORDER listing Scleractinia spp.] Excludes fossils.','','Australia,Cook Islands,Djibouti,Fiji,French Polynesia,Indonesia,Japan,New Caledonia,Palau,Papua New Guinea,Philippines,Samoa,Solomon Islands,Taiwan, Province of China,Tonga,Vanuatu,Viet Nam','AU,CK,DJ,FJ,PF,ID,JP,NC,PW,PG,PH,WS,SB,TW,TO,VU,VN','